import './List.css'
const ListData = (props) => {
  const catg = props.data;
  const clickedItem = (event) => {
    console.log(event.target);
  };
  return (
    <ul class="list-group">
      <div className='row'>
        <div>
          {catg &&
            catg.length > 0 &&
            catg.map((catg, index) => (
              <li
                class="list-group-item"
                key={catg.id}
                onClick={clickedItem}
                id={catg.id}
              >
                {catg.name}
              </li>
            ))}
        </div>
        <div></div>
      </div>
    </ul>
  );
};

export default ListData;
